           	    class Mod_ChangeRXLimits extends FirmwareMod {
        constructor() {
            super("Estender Limites de RX", "Permite a recepção  na faixa de frequência especificada.", 0);
            this.inputMinRX = addInputField(this.modSpecificDiv, ["Especifique um novo valor para a frequência mínima na faixa de 13-1350 MHz: ","MHz"], "50");
            this.inputMaxRX = addInputField(this.modSpecificDiv, ["Especifique um novo valor para a frequência máxima na faixa de 13 a 1350 MHz:","MHz"], "600");

        }

        apply(firmwareData) {
            const offsetLow = 0xe104; //31
            const offsetHi = 0xe134; //31
            const rxStart = parseInt(this.inputMinRX.value) * 100000;
            const rxStop = parseInt(this.inputMaxRX.value) * 100000;

            if ((rxStart <= rxStop) && (rxStart >= 100000) && (rxStart <= 135000000) && (rxStop >= 100000) && (rxStop <= 135000000)) {

                const bufferLow = new ArrayBuffer(4);
                const dataViewLow = new DataView(bufferLow);
                const bufferHi = new ArrayBuffer(4);
                const dataViewHi = new DataView(bufferHi);

                dataViewLow.setUint32(0, rxStart, true);
                dataViewHi.setUint32(0, rxStop, true);

                const rxHexLow = new Uint8Array(bufferLow);
                const rxHexHi = new Uint8Array(bufferHi);

                firmwareData = replaceSection(firmwareData, rxHexLow, offsetLow);
                firmwareData = replaceSection(firmwareData, rxHexHi, offsetHi);

                log(`Sucesso: ${this.name} aplicado.`);
            }
            else {
                log(`Erro ao usar ${this.name}: Dados inválidos! As frequências devem ser superiores a 13 MHz e inferiores a 1300 MHz, o máximo é maior ou igual ao mínimo.`);
            }

            return firmwareData;
        }
    }
